import React from 'react'

import { BiChevronRight } from "react-icons/bi";


const NavSM = () => {


    return (
        <div className="text-gray">

            <div className="text-black">It's All Start Here</div>
            <span>

                bangaleru <BiChevronRight />

            </span>


        </div>
    );
};
//___________________________________________________

const NavMd = () => {

    return(
            <div className="">
            
            <input type="search" className="w-full" 
            placeholder="search for movie" />            
            </div>

    );

     




};
const NavLg = () => { };


//_________________________________


const Navbar = () => {
    return (
        <div>

            <nav>

                <div className="md:hidden">

                    <NavSM />

                </div>   {/* mobile Screen*/}

                <div className="hidden md:flex lg:hidden">  </div>    {/* medium Screen*/}

                <div className="hidden lg:flex">   </div>   {/* Large Screen*/}


            </nav>

        </div>
    );
};

export default Navbar
